"Secara spesifik, album ini dipersembahkan oleh Monkey Boots untuk para wanita yang keras dalam menjalani hidup namun sangat manja dalam urusan bercinta.

Salah satu unit reggae veteran asal Jakarta kembali berdansa. Mereka adalah Monkey Boots, yang baru-baru ini merilis album ke-3 bertajuk Liar dan Mempesona. Lewat album ini pula, mereka melampiaskan sebuah pesan untuk para wanita yang keras menjalani hidupnya, namun disatu sisi mereka sangat manja, khususnya dalam urusan bercinta lewat 10 komposisi musik di album ini. (Baca selengkapnya di https://m.djarumcoklat.com/coklatnews/liar-dan-mempesona-sebuah-karya-album-baru-dari-monkey-boots )

